   "source": [
    "#setting up envirionment\n",
    "install.packages(\"ggplot2\")\n",
    "install.packages(\"palmerspenguin\")\n",
    "library(ggplot2)\n",
    "library(palmerpenguins)\n",
    "data(\"penguins\")\n",
    "#previewing data\n",
    "View(penguins)\n",
    "ggplot(data = penguins)+ geom_point(mapping = aes(x = flipper_length_mm, y = body_mass_g))"
   ]
